function merge(a, b) {
  const merged = {}
  // if it's already keyed, skip
  const allKeys = new Set([...Object.keys(a), ...Object.keys(b)])
  allKeys.forEach((key) => {
    // if it's in the base, keep it
    if (a.hasOwnProperty(key)) {
      merged[key] = a[key]
    }

    // if it's in the new, keep it
    if (!a.hasOwnProperty(key) && b.hasOwnProperty(key)) {
      merged[key] = b[key]
    }
  })

  console.log(JSON.stringify(merged))
  return merged
}

function keyLandscape(list) {
  list.reduce((map, point) => {
    const key = hashPoint(point)
    if (!!map[key]) {
      console.warn(`duplicate point found for ${key}, skipping`)
      return map
    }

    map[key] = point
    return map
  }, {})
}

function hashPoint(point) {
  let h = `${point.position.startX},${point.position.startY}`
  if (typeof point.position.endX === 'number' || typeof point.position.endY === 'number') {
    h += `${point.position.endX ?? ''},${point.position.endY ?? ''}`
  }
  
  return h
}

